SHOW INFO: The Sean Kennedy TV Show was borne from Sean Kennedy&amp;#039;s almost five years of radio DJ experience at the time and various video projects. Every Monday night at 8PM PT/11PM ET Sean Kennedy spoke to a live studio audience and the Internet, broadcasting LIVE on RantTV. The show ran for nineteen episodes with the help of a large crew of volunteers, Sean Kennedy and Cimmerian all being run ragged arranging bands and guests every week. The show was aired live from Endoplasmic Studios - Unit A - 6011 196A Street, Langley, BC, Canada
